INSERT INTO `training` VALUES (1235, 'beberapa uneg2:<br>1. Barat udah blg klo tiktok itu alat propaganda. Mereka bisa menyetir informasi mana yg boleh dikonsumsi ato nggak ke masyarakat internasional, menggiring opini. Klo kalian blg twitter, youtube, dll alat propaganda barat, lah oposisi aja bisa komen seenak jidat di platform mreka. Ini nunjukin value freedom of speech yg ditawarkan barat benar2 diterapkan.<br>2. Klo liat jam itu bukan jam org indo, alias alamat bot farm ada di luar negeri. Saya sih curiga pelaku nya ya dari org2 yg bikin tiktok.<br>3. Mnrut gua alasan mreka mau indo lepas dr unhcr, ya biar lepas dr internasional dan klo indo ada kenapa2/musibah, ya ga ada yg bantuin. Yg ujung2 nya balik k negara mreka. Macem teknik manipulatif dgn cara isolasi yg dipake sama org2 dark triad/antisocial (toxic relationship).<br>4. Saya penasaran knp rohingya dikejar2. Mreka menyimpan rahasia apa?? Sampai diburu bahkan setelah keluar negri. Apa sama kasus nya seperti falun gong atau uyghur?? Buat menyembunyikan kekejaman yg dilakukan oleh pemerintah?? Mengingat myanmar kan juga dekat golden triangle (judi)<br>5. Jgn lupa isu palestina sengaja dihembuskan supaya indo lepas dari UN/PBB. Saya curiga dari blok oposisi, si BRICS. Tapi mainnya kotor banget', 'negatif');
