INSERT INTO `training` VALUES (1254, 'Saya rasa semua pihak punya buzzernya masing-masing, jangan berkelit lah akui saja, ini soal adu kuat-kuatan saja dan terbukti kok salah satu diantaranya memenanginya.<br><br>Di Tiktok dikuasai pihak ini, di X dikuasai pihak ini, apalagi kedua platform tersebut sudah terang-terangan open war (slogannya : &quot;tiktok aplikasi kandang monyet, X kumpulan orang sok pinter dan keblinger&quot;)<br><br>Untuk fb, ig, youtube (produk Meta) gw anggap ketiganya aplikasi khalayak umum dalam artian campur siapa aja ada disana.<br><br>Oiya, ini fun fact<br>Sosmed per hari ini Algoritmanya taik banget<br><br>Kita hanya mengetik sekali saja kata yg ingin kita cari, maka konten-konten selanjutnya yg akan disajikan akan berhubungan dengan kata tersebut dan ini berlaku untuk semua platform<br><br>Seinget gw, dulu mah komposisinya konten yg kita sukai 50%, konten viral 30%, konten lain yg direkomendasikan (konten random) 20%.<br>Sekarang mah najis, komposisinya 80% 10% 10%<br>Makanya kita sangat mudah terpolarisasi seakan sosmed punya agenda terselubung untuk memvalidasi pepatah &quot;Burung yang sejenis akan hinggap di dahan yang sama&quot;.<br><br>Solusinya : jika kita terganggu dengan algoritmanya, cukup scroll aja konten yg kita anggap risih, jangan lama liatin videonya, jangan like, jangan komen, maka akan hilang dengan sendirinya', 'negatif');
