INSERT INTO `training` VALUES (1553, 'Waktu lagi panas-panasnya isu rohingya, saya sempet berpikir &quot;jahat amat orang indo&quot;. Tak kira cuma di media sosial, tapi sentimen kontra-rohingya beneran sampe dunia nyata. Temen-temen, tetangga, dan saudara kalau ditanya soal rohingya, jawabannya tetep satu &quot;jangan terima, pulangin balik&quot;. Bahkan mirisnya teman-teman perkuliahan gak ada satupun yang pro-rohingya. Saat topik HAM dibahas dalam kelas, sungguh ironi bahwa HAM kata mereka tidak untuk rohingya... what a stpd logical fallacy. Entah gimana cara pikir mereka. Apa mereka begitu jahat untuk balikin rohingya kelaut untuk terombang-ambing sampai mati atau jika beruntung mendarat di negaranya lagi untuk mati oleh militer? Sungguh &quot;pembunuhan pasif&quot; ini lebih kejam...<br><br>Seseorang yang kontra-rohingya antara kemakan sentimen-sentimen sosial media atau emang hatinya yang terlanjur sakit...', 'positif');
INSERT INTO `training` VALUES (1554, 'Gw ga pernah main Tiktok mungkin ga akan gw mainin. X juga ga pernah gw buka lagi. Buzzer Pilpres juga beroperasi di Tiktok.', 'positif');
