INSERT INTO `training` VALUES (1583, 'Kalau mau tau itu isu atau bukan main ke Malaysia yang sudah berubah dari negeri Melayu jadi negeri Rohingya 😂', 'positif');
INSERT INTO `training` VALUES (1584, 'Teruntuk Narasi. Dari video saya rasa 80% lebih konten didalamnya membahas mengenai akun-akun buzzer dan influks bot pemerintah Lah. 20% baru membicarakan isu Rohingya dan itupun masih membahas mengenai &quot;siapa yang ngusir&quot; &quot; siapa yang provikasi&quot;. Saya rasa video ini lebih mengarah politis daripada social yang seharusnya ditanamkan. Karena bagaimana dong kita menghadapi &quot;refugee&quot; ini? Kita tahu Lah dan berpengalaman mewadahi pengungsi Vietnam pada zaman Orde Baru dan itu terpusat di Pulau Galang. Tapi waktu Vietnam mulai stabil, tidak ada pengungsi Galang yang secara sukarela ingin kembali bahkan ada yang melakukan perlawanan terhadap aparat maupun bunub diri. Hal ini harus diperhatikan, Yahudi Eropa datang sebagai imigran lalu sekarang menguasai. Malaysia juga coba lihat KL. Mengapa makin banyak orang berkulit hitam hal dari Ceylon, Bangladesh. Sedangkan Melayu, Tionghoa mulai terlihat sedikit. Saya kurang menerima hal &quot;woke&quot; seperti ini. Permasalahan Refugee itu bukan jangka pendek, jangka panjang dan banyak masalah kedepannya. Kita lihat aja apa yang terjadi di Eropa. Dan itu adalah bukti hidup.', 'positif');
INSERT INTO `training` VALUES (1585, 'Ada dua sikap negatif yang sangat menonjol Rakyat Indonesia Sombong dan Mudah Diprovokasi.Rasa sombong ini berasal dari adanya kekurangan dan ketertinggalan dari kelompok lain,dan Rasa sombong ini biasanya ditujukan kepada kelompok atau Individu yang setara dan dibawah nya secara  objektif,sedangkan kepada golongan yang berada diatasnya Ramahnya bukan main dan terkesan menjilat dengan tujuan untuk memperoleh pengakuan untuk menutpi ketidak mampuannya.Sedangkat sifat mudah diprovokasi ini dibuktikan dengan banyaknya peristiwa sepanjang sejarah Indonesia dimana sesama Rakyat Indonesia Saling bunuh membunuh satu sama lain karena tak menyadari menjadi pion politik iknum tertentu.Jutaan orang Indonesia tewas di tangan Saudara sebangsa sendiri,Ribuan kali lipat dari kekuatan dari luar.', 'positif');
