INSERT INTO `training` VALUES (1597, 'Okelah, taruhlah mereka ini memang Buzzer yang dibayar untuk menolak Rohingya. Tapi karena isunya memang masuk akal bahwasanya Indonesia tidak ada kapabilitas untuk menangani imigran jadi masyarakat bakal nerima itu konten.<br>Dari sekitar 18 menit video, tim Narasi hanya menyampaikan data2 analisis yang bagi saya tak penting. Poinnya adalah tunjukan data2 yang valid bahwa masyarakat Aceh sana menerima. Apakah mayoritas menerima? Tunjukkan juga posisi Indonesia, apa sanggup dari segi dana dan tenaga untuk menerima pengungsi?<br>Dengan mewawancarai satu-dua orang lokal yang katanya menerima, ga bisa jadi pembenaran tapi yang ada malah lelucon. :)<br>Tim Narasi juga dengan konyolnya ga memberikan solusi apapun soal ini hanya penyampaian data saja bahwa ternyata ada Buzzer yang dibayar untuk itu. Bisa jadi narasi juga adalah bagian dari Buzzer yang ditugaskan menggiring opini. Entahlah. 😅<br>Jadi kesimpulannya, lebih bijaklah kalo tujuannya mencerdaskan atau berusaha memaparkan data. Jangan lupa kan poin utama juga, yakni solusi yang ada dan tentunya kepentingan rakyat Indonesia yang utama. Salam dan semoga dibaca. :)', 'positif');
