INSERT INTO `youtube_comments` VALUES (200, 'p7-IFOGYxmU', 'Jangan menghujat mereka yang membela-bela kedaulatan negara. Itu bukan kebencian tapi upaya yang untuk mempertahankan masyarakat. Ketika suatu masyarakat dibanjiri oleh orang-orang asing, bukan orang-orang seperti jurnalis ini yang akan menderita hidupnya, bukan dosen-dosen yang mengajarkan ilmu sosiologi di universitas, bukan pula mereka yang bekerja di sektor NGO, tapi orang-orang dari kalangan bawah, orang-orang ini harus bergumul dengan pendatang untuk mendapatkan nafkah. Orang-orang elit itu, dalam keadaan apapun, mereka tidak akan menderita secara ekonomi karena sumber pendapatan mereka sudah tentu. \r<br>\r<br>Saya meminta kepada mereka yang peduli dengan kedaulatan bangasa, budaya dan masyarakat untuk terus menolak kedatangan orang asing. Kita harus mendukung mereka yang telah memasang muka untuk bangsa ini, BUKANNYA menghujat sebagaimana yang jurnalis atau peneliti ini lakukan.', '@AkuCinta-s6b', NULL);
