INSERT INTO `youtube_comments` VALUES (740, 'p7-IFOGYxmU', 'Lah ya kan mmg Indonesia belum meratifikasi konvensi pengungsi 1951 dan protokol 1967. Jadi, Indonesia TIDAK PUNYA KEWAJIBAN UTK MENAMPUNG PENGUNGSI. Karena Indonesia blm meratifikasi konvensi pengungsi, maka seharusnya UNHCR tdk berkantor di Indonesia. UNHCR beroperasi di Indonesia sejak tahun 1979, ketika Pemerintah Indonesia meminta bantuan UNHCR dalam membangun kamp pengungsian di Pulau Galang, untuk menampung lebih dari 170,000 pengungsi yang melarikan diri dari konflik di negara Vietnam. Dan ketika semua pengungsi itu dipulangkan ke negaranya, maka seharusnya KANTOR UNHCR DI INDONESIA DIBUBARKAN. Reporter tolong INTERVIEW PROF. HIKMAHANTO JUWANA. Beliau pakar Hukum Internasional. Dan menentang pemerintah Indonesia menampung pengungsi. Jangan kalian beropini sendiri tanpa bertanya ke ekspertisnya. Apalagi, ada indikasi mereka yg terdampar itu bukan benar2 pengungsi. Mereka adalah SINDIKAT PERDAGANGAN ORANG. Dan tabiat/perangai mereka yg memang buruk. Cerita dari rakyat Malaysia sdh jadi korbannya. Rakyat Indonesia harusnya belajar dr Malaysia yg menyesal menampung mereka HANYA karena BERDASAR KESAMAAN AGAMA.', '@aliazulkarnaen', NULL);
