INSERT INTO `youtube_comments` VALUES (874, 'p7-IFOGYxmU', 'Narasi tidak memandang tentang latar belakang etnik ini saat terjadi konflik di Myanmar . Juga tidak menganalisis bagaimana sikap sosial mereka terhadap Indonesia, termasuk informasi yang benar bahwa Indonesia tidak meratifikasi hukum internatonal tentang pengungsi pendatang. Aceh dan Indonesia sudah berusaha sebaik - baiknya memberikan bantusn KEMANUSIAAN. Seperi menlu sampaikan bahwa Indonesia tidak berkewajiban menerima dan memberi lahan terhadap pengungsi Rohingnya.  Saat mereka melakukan tindakan kriminal, membuang makanan dan segala tingkah laku yang tidak menunjukkan mereka pengungsi dan memililki adab adalah karakter etnis ini yang sudah mandarah daging.  Narasi tidak seimbang dan terkesan membelokkan fakta , juga tidak  menilai dampak sosial, buidaya, keamanan domestik dan kecenderungan reaksi  sosial politik selanjutnya jika etnis  ini ditampung, lalu dinaturalisasi sebagai WNI.  Konfilk dari  tempat asal meraka  di Bangladesj, lalu Myanmar, lalu Malaysia dan Indonesia sudah cukup untuk memberi kewaspadaan tentang etnis ini. Sebagai bangsa yang berdaulat Indonesia telah memberi upaya kemaunisan terbaik. Ini bukan  isu agama seperti kecebderungan di Indonesia, semua aspek hampir selalu dikait-kaitkan dengan SARA.  Narasi kurang memahamiu geo strategi dan tidak mengemukakan opini komperhensif. Urusan mereka adalah dengan negara asal mereka, negara dimana mereka migrasi dan diberi keleluasaan  namun malah memberontak di Myanmar, termasuk tingkah laku mereka ditempat dimana mereka mencari pengungsian sudah lebih dari cukup, untuk tidak memberi ruang terhadap etnis ini di  tanah Indonesia. Anak negeri lebih penting dan barada dalam skala prioritas kebangsaan daripada pengungsi yang dampak kedepannya kita tidak tahui. Biang kerok dari segala carut marut ini ada ditangan UNHCR, benar . Namun, menerima dan memberi ruang wilayah kepada mereka adalah tidak mungkin dan beresiko  membahayakan negara. Narasi juga bertanggung jawab atas opini terbuka ini jika ternyata 30 tahun lagi terjadi konflik horizontal  karena etnis ini. Bukankah di Aceh dan beberapa wilayah di Jawa telah terjadi?. Kenapa Narasi &quot; tutup mata&quot;?. Saya salah satu yang menyaksikan sendiri tingkah laku mereka di daerah Tangerang saat mereka menolak bantuan kemanusiaan hingga relokasi dan menuntut dibawa ke Australia. dan saya  bukan satu-satunya yang menyksikan. Ada banyak anak negeri yang mengalami, terutama di Aceh.', '@bambangtheo5640', NULL);
